script: |
  super -f tsv -I q27.sql | sort > q27.out

vector: true

inputs:
  - name: q27.sql
    data: |
      SELECT ALL - COUNT ( * ) - - 91 AS col0 FROM tab1 AS cor0 WHERE - col2 * + col0 + ( col0 ) * + col0 + - col2 * + col0 IS NULL AND NOT ( 74 * + + col2 ) > col1;
  - name: tab1

outputs:
  - name: q27.out
    data: |
      91
